import React from 'react';

export default function Item(props) {
  return (
    <div onClick={e => props.handleOrderClick(e)}>
      <tr className="item">
        <th className="number">{props.item.qnt}</th>
        <th>{props.item.item}</th>
        <th className="number">{props.item.price}</th>
      </tr>
    </div>
  );
}
